import React from 'react';
import './directory-item.style.css';

const MenuItem = ({title}) => (
    <div className='menu-item'>
        <div className='menu-item-content'>
            <h3 className='menu-item-title'>{title}</h3>
        </div>
    </div>
);

export default MenuItem;
